import './header.css';

import './App.css';
import { Routes, Route } from "react-router-dom";
import LoginForm from './LoginForm';
import RegisterForm from './RegisterForm';
import CarGrid from './CarGrid';
import UserList from './adminPg/UserList';
import CarsTest from './adminPg/CarsTest'
import BackOffice from './adminPg/BackOffice';
function App() {
  return (
    <div className="App">
      <Header/>
    <Routes>
        <Route path="/" element={ <LoginForm/> } />
        <Route path="RegisterForm" element={ <RegisterForm/> } />
        <Route path="CarGrid" element={<CarGrid/>}/>
        <Route path="CarsTest" element={<CarsTest/>}/>      
        <Route path="UserList" element={<UserList/>}/>
        <Route path="BackOffice" element={<BackOffice/>}/>
        </Routes>
      </div>
  );
}
const Header = () => {
  return (
    <header className="header">
      <h1 className="header-title">AutoRent24</h1>
    </header>
  );
};

export default App;
